insert  into `document`(`document_id`,`document_title`,`document_template`,`doc_folder_id`,`doc_category_id`,`status`,`created_on`,`updated_on`,`form_steps`) values (14,'Some Template','<p>Dear {firstname},</p>\r\n<p>Welcome to Leica Biosystems. We are taking you on as a {designation} with compensation of {salary}.</p>\r\n<p>&nbsp;</p>\r\n<p>Regards,</p>\r\n<p>Rohit Naik</p>\r\n<p>{signature_hr_admin}</p>\r\n<p>&nbsp;</p>\r\n<p>Acknowledgement Note : {acknowledgement_note}</p>\r\n<p>&nbsp;</p>',7,8,1,'2019-01-23 12:12:19','2019-01-24 11:53:33',2),(15,'Joining Letter','<p>Dear {first_name},</p>\r\n<p>Welcome to our Organization. You are employed with our organization effective {joining_date}. Your designation will be {designation}.</p>\r\n<p>Please sign this letter as acceptance.</p>\r\n<p>&nbsp;</p>\r\n<p>Warm Regards,</p>\r\n<p>{signature_hr_admin}</p>\r\n<p>HR Admin</p>\r\n<p>&nbsp;</p>\r\n<p>I accept the offer.</p>\r\n<p>{signature_new_associate}</p>',7,8,1,'2019-01-23 12:15:50','0000-00-00 00:00:00',2),(16,'Offer Letter','<p>Dear {first_name},</p>\r\n<p>&nbsp; Do you accept this fantastic offer. I don\'t believe you will get a better one anywhere. If you do please sign below my signature.</p>\r\n<p>&nbsp;</p>\r\n<p>HR ADMIN</p>\r\n<p>{signature_hr_admin}</p>\r\n<p>&nbsp;</p>\r\n<p>I accept this absolutely fantastic offer.</p>\r\n<p>&nbsp;</p>\r\n<p>ASSOCIATE</p>\r\n<p>{signature_new_associate}</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',7,8,1,'2019-01-23 13:16:54','2019-01-31 10:55:30',2),(17,'Thank you note','<p>Hi,</p>\r\n<p>{thank_you_note}</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>{signature_new_associate}</p>',8,9,1,'2019-01-24 11:24:40','0000-00-00 00:00:00',1),(18,'Test letter','							<p>This is a test letter.</p>\r\n<p>{signature_hr_admin}</p>\r\n<p> </p>\r\n<p>I accept</p>\r\n<p>{signature_new_associate}</p>						',7,8,0,'2019-01-28 06:19:26','2019-02-25 05:58:06',2),(19,'Testing Document','<p>Hello {name},</p>\r\n<p>This is testing document.</p>\r\n<p>&nbsp;</p>\r\n<p>{signature_hr_admin}</p>\r\n<p>&nbsp;</p>\r\n<p>{full_name} is new associate.</p>\r\n<p>{signature_new_associate}</p>',7,8,1,'2019-01-31 09:39:33','0000-00-00 00:00:00',2),(20,'GM_Two_Signature Form','<p>Dear {first_name},</p>\r\n<p>&nbsp;</p>\r\n<p>This is a document to create couple of signatures. One for the HR Admin</p>\r\n<p>{signature_hr_admin}</p>\r\n<p>&nbsp;</p>\r\n<p>I, {first_name} {last_name} And the second one for the New Associate.</p>\r\n<p>{signature_new_associate}</p>\r\n<p>&nbsp;</p>',7,8,1,'2019-02-04 06:36:04','0000-00-00 00:00:00',2),(21,'GM_One_Step_Form','<p>Dear {first_name},</p>\r\n<p>&nbsp; Please sign the doucment here and return.</p>\r\n<p>&nbsp;</p>\r\n<p>Signature,</p>\r\n<p>{signature_new_associate}</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',8,9,1,'2019-02-04 06:42:31','0000-00-00 00:00:00',1),(22,'Test Doucment','',7,8,1,'2019-02-10 06:46:51','2019-02-13 04:09:41',2),(23,'Communication Document','<p>Hello <a class=\"active-variable justify-content-between list-group-item list-group-item-action border-0\" data-field_name=\"FirstName\" data-varname=\"{firstname}\">{firstname}<span class=\"badge badge-primary badge-pill\">HR Associate,</span></a></p>\r\n<p>This is a test.</p>\r\n<p><a class=\"active-variable justify-content-between list-group-item list-group-item-action border-0\" data-field_name=\"HRSignature\" data-varname=\"{hrsignature}\">{hrsignature}<span class=\"badge badge-primary badge-pill\">HR Associate</span></a></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"badge badge-primary badge-pill\">I acknowledge</span></p>\r\n<p><a class=\"active-variable justify-content-between list-group-item list-group-item-action border-0\" data-field_name=\"NewAssociate\" data-varname=\"{newassociate}\">{newassociate}<span class=\"badge badge-primary badge-pill\">New Associate</span></a></p>',7,8,1,'2019-02-13 04:09:07','2019-02-13 04:12:08',2),(24,'Electronic Communication Policy','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\">LEICA MICROSYSTEMS, INC.</span><br /><span style=\"text-decoration: underline;\">ELECTRONIC COMMUNICATIONS POLICY</span></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: left;\"><span style=\"text-decoration: underline;\">Scope of Policy</span><br />This document sets forth the policies of Leica Microsystems, Inc. (&ldquo;Leica&rdquo;) regarding the use of its electronic communications systems (&ldquo;systems&rdquo;), which include but are not limited to electronic mail, voice mail, facsimiles, computers and related equipment, the intranet, and the Internet and the World Wide Web. All those who use Leica&rsquo;s systems agree by such use to comply with the rules outlined in this Policy. Use of Leica&rsquo;s systems is a privilege that may be revoked in Leica&rsquo;s sole discretion, and one that automatically terminates upon your departure from Leica.</p>\r\n<p style=\"text-align: left;\"><br /><span style=\"text-decoration: underline;\">Ownership of Information and Employee Responsibility</span><br />Leica&rsquo;s systems and all information stored on them are Leica property. All information and messages that are created, sent, received, accessed, or stored using Leica&rsquo;s systems constitute Leica records. Leica owns all information on its systems as well as all information related to Leica business stored on your own personal computer. Upon employment, each individual permitted to use Leica&rsquo;s computer network becomes responsible for protecting the resources and data over which he or she has control. This includes protection of physical property and electronic data, regardless of how the data is collected or stored. The unauthorized use, modification, or destruction of data or other computing resources is prohibited. Employees must respect the rights of other computer network users. Knowingly accessing or sharing data files without owners permission is prohibited. It is the employee responsibility to report loss of, or damage to, any Leica computer or information. Individual users are also responsible for their own computer files and protecting Leica passwords. Users should not circumvent normal resource limits, logon procedures, or security provisions.</p>\r\n<p style=\"text-align: left;\"><span style=\"text-decoration: underline;\">Business Use</span><br />Leica&rsquo;s systems are provided at Leica&rsquo;s expense and should be used to conduct Leica business. Your use of Leica\'s systems should not interfere with the performance of your job or with others&rsquo; performance of their jobs, should not otherwise interfere with Leica business, and should not otherwise violate this Policy or other Leica policies.<br />Security of Electronic Communications<br />Because electronic communications are not inherently secure, you should not send confidential, proprietary, or sensitive information to third parties through e-mail, the Internet, or the World Wide Web without prior authorization from your<br />manager or without first encrypting such messages using Leica-authorized encryption.<br />Leica Electronic Communications Policy, Page 2<br />No Presumption of Privacy/Leica&rsquo;s Right to Monitor Messages<br />Communications on Leica&rsquo;s systems are not private. Any passwords or user IDs used to access Leica&rsquo;s systems are designed to protect Leica&rsquo;s confidential information from outside third parties, not to provide users of Leica&rsquo;s systems with personal privacy in the messages. You should also recognize that all connections and sites you visit in surfing the Internet and World Wide Web may be monitored and recorded. Leica reserves the rights to monitor, access, retrieve, and read all messages created, sent, accessed, received, or stored on Leica&rsquo;s systems without prior notice to the originators and recipients of such messages. Leica may also disclose such messages to law enforcement officials, to other third parties when Leica is legally required to do so, and to third parties and authorized Leica personnel where required for business purposes. Without limitation to the above, Leica also reserves the right to monitor chat rooms and newsgroups, and may examine any material you have uploaded from or downloaded to any of Leica&rsquo;s systems. Leica may at any time monitor, access, retrieve, read, and disclose your electronic communications involving any of Leica\'s systems under the following circumstances:<br />&bull; When Leica has a legitimate business need to do so;<br />&bull; When Leica suspects that a Leica systems user has engaged, or is about to engage, in inappropriate conduct using any of Leica&rsquo;s systems, including violating this Policy or any other Leica policy;<br />&bull; When required by law, by legal duties to third parties, or in order to protect Leica&rsquo;s own interests; or<br />&bull; When the Leica systems user in question is unavailable (e.g., ill, on vacation or leave, no longer working for Leica).<br />Leica reserves the right to keep your e-mail address active for a reasonable period of time following your departure from Leica to ensure that important business communications reach Leica.<br />Message Restrictions<br />Communications on Leica&rsquo;s systems may not contain content that a reasonable person would consider to be defamatory, offensive, profane, abusive, obscene, threatening, harassing, disruptive, or derogatory, including but not limited to sexual comments or images, racial or ethnic slurs, or other comments or images that would reasonably offend someone on the basis of race, color, religion, national origin, citizenship status, veterans&rsquo; status, sex, sexual orientation, marital status, disability, age, or any other characteristic protected by law.<br />Leica Electronic Communications Policy, Page 3<br />Prohibited Activities<br />You may not use Leica&rsquo;s systems to:<br />&bull; Upload, download, or otherwise transmit copyrighted, trademarked, or patented material; trade secrets; or other confidential, private, or proprietary information or materials in violation of the law;<br />&bull; Upload, download, or otherwise transmit any illegal information or materials, or otherwise engage in any illegal activity;<br />&bull; Upload, download, access, create, distribute, or otherwise transmit sexually explicit materials;<br />&bull; Upload, download, access, create, distribute or otherwise transmit materials that advocate violence, hatred, or discrimination toward other people;<br />&bull; Gain unauthorized access to remote computers or other systems, or damage, alter, or disrupt such computers or systems in any way;<br />&bull; Use someone else&rsquo;s code or password, or disclose anyone&rsquo;s code or password, including your own;<br />&bull; Create, distribute, or otherwise transmit chain letters, junk e-mail or faxes, or any other electronic communications that could constitute a nuisance or violate the law;<br />&bull; Falsify addressing information to conceal the sender&rsquo;s or recipient&rsquo;s identity or otherwise create or distribute anonymous messages;<br />&bull; Enable unauthorized third parties to have access to or use Leica&rsquo;s systems, or otherwise jeopardize the security of Leica&rsquo;s systems;<br />&bull; Pass off your views as representing those of Leica or commit Leica to a particular position without appropriate authorization;<br />&bull; Post information, opinions, or comments to Internet discussion groups, subscriber lists, and other such forums unless such postings are related to a legitimate business activity of Leica; are professional (e.g., must not disparage a competitor or competitor product), accurate, and not contrary to any Leica interests or policy; and do not contain confidential or otherwise inappropriate details about Leica product plans, customers, or technology;<br />&bull; Additionally, you may not use any non-Leica authorized encryption in connection with any of Leica&rsquo;s systems;<br />&bull; Send inappropriate jokes or other offensive communications; political causes; football pools or other sorts of gambling; subscription lists for non-Leica purposes; or solicitations or advertisements for non-Leica purposes.<br />Leica Electronic Communications Policy, Page 4<br />Message Creation<br />Although electronic communications seem transitory, like a phone call, they are in fact remarkably permanent. Because creating electronic messages is very much like using electronic letterhead that carries your name and Leica&rsquo;s name, you must use great care in creating and transmitting messages on Leica&rsquo;s systems. Even when a message has been deleted, it may still exist on a back-up system, may be recreated, may have been printed out, may have been forwarded to someone else, or may have been viewed by someone other than your intended recipient (whose own e-mail communications may be monitored by an employer, for example). The electronic messages that you are creating today may someday have to be produced by Leica in connection with a lawsuit. Always remember that all of your electronic communications reflect on Leica, despite any disclaimers that you may make.<br />Record Retention and Deletion<br />As with paper documents that you create and receive, it is your responsibility to ensure that electronic messages are saved or deleted according to Leica&rsquo;s record retention policies. Any related questions should be directed to your supervisor/manager.<br />Viruses and Tampering<br />Any files downloaded from the Internet, attachments to e-mail messages, and computer disks received from non-Leica sources must be scanned with virus detection software before installation, execution, or use. Introduction of viruses, attempts to breach system security, or other malicious tampering with regard to any of Leica&rsquo;s systems are expressly prohibited. You must immediately report any viruses, tampering, or other breaches of any of Leica&rsquo;s systems to your supervisor/manager.<br />Selling and Purchasing<br />Leica&rsquo;s standard purchase and sales policies apply to all purchase- and sales-related activities conducted via Leica&rsquo;s systems. Absent permission from your supervisor/manager, you may not use Leica resources to pay Internet/World Wide Web subscription fees or access charges, including but not limited to independent Internet service provider subscription fees.<br />Violations<br />Employees should report any violations of this policy to their Supervisor. Violations of this Policy, including breaches of confidentiality or security, may result in suspension of systems privileges and disciplinary action, up to and including termination. To the extent that violations of this Policy may also constitute violations of other Leica policies or various laws, Leica reserves the right to take additional action in accordance with such policies or laws. Leica reserves the right to hold you personally liable for any violations of this Policy.<br />Leica Electronic Communications Policy, Page 5<br />Leica Electronic Communications Policy<br />I have read Leica Microsystems, Inc.\'s Electronic Communications Policy and agree to abide by it as consideration for my continued employment by Leica Microsystems, Inc. I understand that violation of any above policies may result in my termination.</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">-----------------------------------------------------</p>\r\n<p style=\"text-align: left;\">{employee_name}</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">------------------------------------------------------</p>\r\n<p style=\"text-align: left;\">{signature_new_associate}</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">------------------------------------------------------</p>\r\n<p style=\"text-align: left;\">{date}</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>',7,9,1,'2019-02-22 08:37:55','2019-02-22 13:30:28',2),(25,'Equipment Acceptance and Reimbursement Agreement','<p>EQUIPMENT ACCEPTANCE AND REIMBURSEMENT AGREEMENT<br />I, <span style=\"text-decoration: underline;\">{full_name}</span>, hereby acknowledge, agree and<br />(Employee\'s Name)<br />understand that Leica Microsystems Inc. (hereinafter \"the Company\") has provided me<br />with Company inventory, demo equipment or other tangible items (hereinafter<br />\"equipment\") which are solely and exclusively for the purpose of, and necessary to, my<br />employment with the Company. I further acknowledge, agree and understand that I<br />have been provided with this equipment to assist me with the performance of my duties<br />on behalf of the Company and for no other purpose; that this arrangement operates to<br />my benefit; and that the equipment provided to me by the Company is, and remains at<br />all times, the sole and exclusive property of the Company</p>\r\n<p>&nbsp;</p>\r\n<p>By {full_name}</p>\r\n<p>-----------------------------------------</p>\r\n<p>Name</p>\r\n<p>&nbsp;</p>\r\n<p>{signature_hr_admin}</p>\r\n<p>-----------------------------------------</p>\r\n<p>Signature</p>\r\n<p>&nbsp;</p>\r\n<p>{todays_date}</p>\r\n<p>-----------------------------------------</p>\r\n<p>Date</p>',8,9,1,'2019-02-22 09:42:36','2019-02-22 09:43:26',1),(26,'SOFTWARE POLICY','<p><span style=\"text-decoration: underline;\">General Statement of Policy</span><br />It is the policy of Leica Microsystems, Inc. to respect all computer software copyrights and to adhere to the terms of all software licenses to which Leica Microsystems, Inc. is a party. The IT Department manages license compliance, and is charged with the responsibility for enforcing these guidelines.<br />Leica Microsystems, Inc. users may not duplicate any licensed software or related documentation for use either on Leica Microsystems, Inc. premises or elsewhere unless Leica Microsystems, Inc. is expressly authorized to do so by agreement with the licenser. Unauthorized duplication of software may subject users and/or Leica Microsystems, Inc. to both civil and criminal penalties under the United States Copyright Act.</p>\r\n<p>{fullname}</p>\r\n<p>-------------------------------------</p>\r\n<p>User Name</p>\r\n<p>&nbsp;</p>\r\n<p>{signature_new_associate}</p>\r\n<p>--------------------------------------</p>\r\n<p>Signature</p>\r\n<p>&nbsp;</p>\r\n<p>{todays_date}</p>\r\n<p>---------------------------------------</p>\r\n<p>Date</p>',7,8,1,'2019-02-22 13:26:54','0000-00-00 00:00:00',2);

