/*Data for the table `email_template` */

insert  into `email_template`(`template_id`,`template_name`,`template_description`,`template_subject`,`template_body`,`updated_on`) values (1,'forgot_password','This template is used for forgot password email.','Forgot Password from template','<p>This is template for forgot password {first_name}.</p>','2019-02-15 06:32:14'),(2,'welcome_associate','This template is used when new associate is created.','Welcome','<p>Welcome to Leica Biosystems!</p>\r\n<p>It\'s going to be a great year and we are excited to have you join Leica Biosystems and be part of our team.</p>\r\n<p>Your first day will be on {start_date} and reporting to {manager_name}, HR Manager.</p>\r\n<p>We are a Danaher Company.  We believe our associates are our best asset and as we say here “Best Team Wins”, regardless of whether you will be dealing directly with customers or providing support to those associates who do. </p>\r\n<p>It is our associates who uphold our Mission - Advancing Cancer Diagnostics, Improving Lives and our Vision24 - enabling patients to receive their diagnosis within 24 hours from biopsy.  No other company is positioned to streamline the whole process.  We truly have an impact on improving lives.  We are so excited that you joined us in our journey.</p>\r\n<p>Following this letter, is your New Associate Packet.  Please review all the documents.  All documents requiring your signature will need to be submitted.  Your timeliness on signing the forms will help to make your onboarding process a success.</p>\r\n<p>Again, welcome to the Team and we are so excited about your decision to join Leica Biosystems!  All of us extend a warm welcome to you and wish you the best of success at Leica!</p>\r\n<p>If you have questions prior to the start date, please contact me at 847-405-5457 or send me an email at alina.waity@leicabiosystems.com.   We look forward to having you come onboard.</p>\r\n<p>Your can login on {welcome_url} with username : {user_name} and password : 123456.</p>\r\n<p> </p>\r\n<p>Best Regards,</p>\r\n<p>Alina Waity</p>\r\n<p>Sr. Human Resources Coordinator</p>','2019-02-22 05:05:17'),(3,'verified_document','This template is used when document is verified.','Document Verified','<p>Dear {first_name} {last_name},</p>\r\n<p>Congratulations!</p>\r\n<p>You have successfully returned all required documents and your onboarding process is well underway.  We are looking forward for you to attend the New Associate Orientation (NAO) held in Buffalo Grove, IL.  Please lookout for further NAO communications to your home email address from me.</p>\r\n<p>If you have questions prior to the start date, please contact me at 847-405-5457 or send me an email at alina.waity@leicabiosystems.com.   We look forward to having you come onboard.</p>\r\n<p> </p>\r\n<p>Best Regards,</p>\r\n<p>Alina Waity</p>\r\n<p>Sr. Human Resources Coordinator</p>','2019-02-08 06:03:10'),(4,'rejected_document','This template is used when document is rejected.','Document Rejected','<p>Dear {first_name} {last_name},</p>\r\n<p>Upon reviewing your signed documents, I have noticed the following missing documents:</p>\r\n<p>{document_title}</p>\r\n<p>You will need to sign in back to your portal and complete/sign the remaining documents.  Your timeliness on signing the forms will help to make your onboarding process a success.</p>\r\n<p>If you have questions prior to the start date, please contact me at 847-405-5457 or send me an email at alina.waity@leicabiosystems.com.   We look forward to having you come onboard.</p>\r\n<p> </p>\r\n<p>Best Regards,</p>\r\n<p>Alina Waity</p>\r\n<p>Sr. Human Resources Coordinator</p>','2019-02-08 06:04:09'),(5,'follow_up','This template is used for follow-up email which is sent manually to new associate.','Follow-Up letter','<p>Hello {first_name} {last_name},</p>\r\n<p>I am following up regarding your New Associate Packet.  As of today, I have not yet received your signed documents back. </p>\r\n<p>Please review all the documents.  All documents requiring your signature will need to be submitted.  Your timeliness on signing the forms will help to make your onboarding process a success.</p>\r\n<p>If you have questions prior to the start date, please contact me at 847-405-5457 or send me an email at alina.waity@leicabiosystems.com.   We look forward to having you come onboard.</p>\r\n<p> </p>\r\n<p>Best Regards,</p>\r\n<p>Alina Waity</p>\r\n<p>Sr. Human Resources Coordinator</p>','2019-02-08 06:05:37');

