/*Table structure for table `users_role_mapping` */

DROP TABLE IF EXISTS `users_role_mapping`;

CREATE TABLE `users_role_mapping` (
  `users_role_mapping_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT 'user_id from users table',
  `role_id` int(20) NOT NULL COMMENT 'role_id from role table',
  PRIMARY KEY (`users_role_mapping_id`),
  KEY `role_id` (`role_id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `users_role_mapping_ibfk_1` FOREIGN KEY (`role_id`) REFERENCES `role` (`role_id`),
  CONSTRAINT `users_role_mapping_ibfk_2` FOREIGN KEY (`user_id`) REFERENCES `users` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=157 DEFAULT CHARSET=latin1;

